package com.rongke.model;import com.baomidou.mybatisplus.annotations.TableField;import com.baomidou.mybatisplus.annotations.TableId;import com.baomidou.mybatisplus.annotations.TableName;import com.baomidou.mybatisplus.enums.IdType;import com.fasterxml.jackson.annotation.JsonFormat;import java.io.Serializable;/** * @User * @用户(user) * @version : Ver 1.0 */@TableName("sys_global")public class SysGlobal implements Serializable {	@TableField(exist = false)	private static final long serialVersionUID = 1L;	/**	 * @备注:用户表id	 * @字段:id BIGINT(19)	 */	@TableId(type = IdType.AUTO)	@JsonFormat(shape = JsonFormat.Shape.STRING)	private Long id;	/**	 *	名字	 */	private String sysName;	/**	 *	keys	 */	private String sysKeys;	/**	 *	内容	 */	private String sysValues;	/**	 *	类型	 */	private Integer sysType;	public Long getId() {		return id;	}	public void setId(Long id) {		this.id = id;	}	public String getSysName() {		return sysName;	}	public void setSysName(String sysName) {		this.sysName = sysName;	}	public String getSysKeys() {		return sysKeys;	}	public void setSysKeys(String sysKeys) {		this.sysKeys = sysKeys;	}	public String getSysValues() {		return sysValues;	}	public void setSysValues(String sysValues) {		this.sysValues = sysValues;	}	public Integer getSysType() {		return sysType;	}	public void setSysType(Integer sysType) {		this.sysType = sysType;	}	public String toString() {		return "SysGlobal{" +				"id=" + id +				", sysName='" + sysName + '\'' +				", sysKeys='" + sysKeys + '\'' +				", sysValues='" + sysValues + '\'' +				", sysType=" + sysType +				'}';	}}